const A="Microbiology Chapter 13 Homework",I="Homework questions for Microbiology Chapter 13.",g="Microbiology",C=[{id:"mc-ch13-hw-1",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 13",topic:"Microscopy and Staining",difficulty:"easy",question:"Horses have the ability to make their own surfactants.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. Like most mammals, horses produce pulmonary surfactant in their lungs to reduce surface tension and prevent alveolar collapse."},{id:"mc-ch13-hw-2",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 13",topic:"Microscopy and Staining",difficulty:"easy",question:"The arrow is pointing to the hydrophilic head.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. The arrow is pointing to the hydrophobic (water-fearing) tail of the surfactant molecule. The hydrophilic (water-loving) head would be oriented towards the water."},{id:"mc-ch13-hw-3",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 13",topic:"Microscopy and Staining",difficulty:"easy",question:"Surfactants have the ability to increase surface tension.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. Surfactants are surface-active agents that lower the surface tension of a liquid."},{id:"mc-ch13-hw-4",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 13",topic:"Microscopy and Staining",difficulty:"medium",question:"This is foam from the tungara frog who builds these to create a pathogen reduced environment for its eggs.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. The foam nests of the túngara frog contain a cocktail of proteins, including surfactants, that have antimicrobial properties, protecting the eggs from pathogens."},{id:"mc-ch13-hw-5",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 13",topic:"Microscopy and Staining",difficulty:"medium",question:"RSN-2 is not a gentle surfactant.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. RSN-2 (ranaspumin-2) is a surfactant protein found in the foam nests of the túngara frog and is known for its gentle and stable properties."}],f={name:A,description:I,subject:g,questions:C};export{f as default,I as description,A as name,C as questions,g as subject};
